// Import Styled
import styled from 'styled-components';

export const TextDefault = styled.text`
	color: #79828B;
	font-size: 14px;
	line-height: 21px;
	letter-spacing: 0.75px;
	display: block;
	padding: 12px 0 8px;
	strong{
		color: #10C172;
	}
`;
